INSERT INTO `TRIGGERS` (`TRIGGER_CATALOG`, `TRIGGER_SCHEMA`, `TRIGGER_NAME`, `EVENT_MANIPULATION`, `EVENT_OBJECT_CATALOG`, `EVENT_OBJECT_SCHEMA`, `EVENT_OBJECT_TABLE`, `ACTION_ORDER`, `ACTION_CONDITION`, `ACTION_STATEMENT`, `ACTION_ORIENTATION`, `ACTION_TIMING`, `ACTION_REFERENCE_OLD_TABLE`, `ACTION_REFERENCE_NEW_TABLE`, `ACTION_REFERENCE_OLD_ROW`, `ACTION_REFERENCE_NEW_ROW`, `CREATED`, `SQL_MODE`, `DEFINER`, `CHARACTER_SET_CLIENT`, `COLLATION_CONNECTION`, `DATABASE_COLLATION`) VALUES
('def', 'examen', 'T1', 'INSERT', 'def', 'examen', 'reservas', 0, NULL, 'begin\nUPDATE vehiculos SET numtrayectos = numtrayectos+1;\nUPDATE conductores SET servicios = servicios+1;\nINSERT INTO eventos(operacion, clave, fecha) VALUES("ALTA RESERVAS", new.idReserva, now());\nend', 'ROW', 'AFTER', NULL, NULL, 'OLD', 'NEW', NULL, '', 'root@localhost', 'utf8', 'utf8_general_ci', 'utf8_unicode_ci'),
('def', 'examen', 'T2', 'DELETE', 'def', 'examen', 'reservas', 0, NULL, 'begin\nUPDATE vehiculos SET numtrayectos = numtrayectos-1;\nUPDATE conductores SET servicios = servicios-1;\nINSERT INTO eventos(operacion, clave, fecha) VALUES("BAJA RESERVAS", old.idReserva, now());\nend', 'ROW', 'BEFORE', NULL, NULL, 'OLD', 'NEW', NULL, '', 'root@localhost', 'utf8', 'utf8_general_ci', 'utf8_unicode_ci'),
('def', 'foje', 'T1', 'DELETE', 'def', 'foje', 'original', 0, NULL, 'BEGIN\nINSERT INTO HISTORICO SELECT * FROM ORIGINAL WHERE IDVOLUNTARIO=OLD.IDVOLUNTARIO;\nEND', 'ROW', 'BEFORE', NULL, NULL, 'OLD', 'NEW', NULL, 'NO_AUTO_VALUE_ON_ZERO', 'root@localhost', 'utf8', 'utf8_general_ci', 'utf8_unicode_ci'),
('def', 'transporte', 'T1', 'INSERT', 'def', 'transporte', 'reservas', 0, NULL, 'begin\nUPDATE conductores SET servicios = servicios+1 WHERE idvoluntario=new.idvoluntario;\nend', 'ROW', 'AFTER', NULL, NULL, 'OLD', 'NEW', NULL, '', 'root@localhost', 'utf8', 'utf8_general_ci', 'utf8_unicode_ci');
